<p>Following the Ant Design specification, we will add one space between if Button (exclude Text button and Link button) contains two Chinese characters only. If you don't need that, you can use <a href="/components/config-provider/#API">ConfigProvider</a> to set <code>autoInsertSpaceInButton</code> as <code>false</code>.</p>
